import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Footer from './component/footer';
import FaqData from './component/faq';
import CourseInfo from './component/card';
import WhyUsSlider from './component/slider';
import CourseIntro from './component/home';
import StatsSection from './component/section';
import Navbar from './component/navbar';
import All from './Allpage';


function App() {
  return (
    <Router>
      <All></All>
      <Routes>
        <Route path="/" element={<CourseIntro />} />
        <Route path="/about" element={<About />} />
        <Route path="/how-we-work" element={<HowWeWork />} />
        <Route path="/why-us" element={<WhyUsSlider />} />
        <Route path="/results" element={<StatsSection />} />
        <Route path="/faq" element={<FaqData />} />
      </Routes>
      <CourseInfo />
      <Footer />
    </Router>
  );
}

export default App;
